<script>
    import { ChevronLeft, Ellipsis, Camera, SendHorizontal, Trash2 } from "@lucide/svelte";
    import InvalidImageModal from "$lib/components/ui/InvalidImageModal.svelte";

    let currentChatAttachment = $state([]);

    let senderAName = $state("Dill");
    let senderBName = $state("Grok");

    let senderAProfile = $state(null);
    let senderBProfile = $state(null);

    let inReview = $state(false);
    let canReview = $state(true);
    let title = $state("Suche Nachhilfe");
    let messages = $state([
        {
            sender: "A",
            message: "Hi",
            date: Date.now() - 1000 * 50 - (1000 * 60 * 60 * 28),
            attachment: []
        },
        {
            sender: "B",
            message: "Moin!",
            date: Date.now() - 1000 * 30 - (1000 * 60 * 60 * 28),
            attachment: []
        },
        {
            sender: "B",
            message: "Blah Blah!",
            date: Date.now() - 1000 * 28 - (1000 * 60 * 60 * 28),
            attachment: []
        },
        {
            sender: "A",
            message: "Good?",
            date: Date.now() - 1000 * 10,
            attachment: [
                "data:image/jpeg;base64,"
            ]
        }
    ]);

    const openReview = () => {
        if(!canReview) return;
        inReview = true;
    }

    const getNewProfilePicture = () => {
        const element = document.getElementById("fileInput");
        const files = element.files;

        for(let i = 0; i < files.length; i++) {
            const file = files[i];
            const reader = new FileReader();
            reader.readAsDataURL(file);
            reader.onload = function () {
                if(reader.result.startsWith("data:image/")) {
                    currentChatAttachment.push(reader.result);
                    // TODO: Upload new profile picture
                } else {
                    document.getElementById("modal_invalid_datatype").showModal();
                    currentChatAttachment = [];
                }
            };
        }
    }

    const sendMessage = () => {
        const text = document.getElementById("chatInput").value;
        if((!text || text.length === 0) && currentChatAttachment.length <= 0) return;

        console.log(`MESSAGE: ${text}`);
        console.log(`ATTACHMENT: ${currentChatAttachment}`);

        let attachments = [];
        currentChatAttachment.forEach(attachment => attachments.push(attachment));

        const message = {
            sender: "B",
            message: text,
            date: Date.now(),
            attachment: attachments
        }

        messages.push(message);

        currentChatAttachment = [];
        document.getElementById("chatInput").value = "";

        // TODO: send backend request to save this message
    }

    const finishReview = () => {
        if(!canReview) {
            inReview = false;
            return;
        }

        const rating = document.querySelector('input[name="rating-11"]:checked').value;
        inReview = false;

        console.log(`Rating: ${rating}`);
    }
</script>

<div class="flex-container {inReview ? 'blur-xs' : ''}">
    <div class="sticky-header flex w-full mt-2 border-b border-base-400 pb-2">
        <div class="flex ml-2" style="width: 33% !important;">
            <ChevronLeft size={24} class="my-auto"/>
        </div>
        <p class="text-lg my-auto font-bold"><nobr>{title}</nobr></p>
        <div class="flex justify-end mr-2" style="width: 33% !important;">
            {#if canReview}
                <button onclick={() => openReview()}>
                    <Ellipsis size={24} class="my-auto" />
                </button>
            {/if}
        </div>
    </div>

    <div class="content mx-2 mt-2">
        {#each messages as message, i}
            {#if i === 0 || new Date(messages[i].date).toLocaleDateString() !== new Date(messages[i - 1].date).toLocaleDateString()}
                <div class="divider">
                    {new Date(messages[i].date).toLocaleDateString()}
                </div>
            {/if}

            {#if message.sender === 'A'}
                <div class="chat chat-start">
                    <div class="chat-image">
                        <div class="chat-image">
                            {#if senderAProfile === null}
                                <div class="avatar avatar-placeholder">
                                    <div class="bg-neutral text-neutral-content w-10 rounded-full">
                                        <span class="text-2xl">{senderAName[0]}</span>
                                    </div>
                                </div>
                            {:else}
                                <div class="avatar">
                                    <div class="w-10 rounded-full ring-2">
                                        <img src={senderAProfile} />
                                    </div>
                                </div>
                            {/if}
                        </div>
                    </div>
                    <div class="chat-header">
                        {senderAName}
                        <time class="text-xs opacity-50">{new Date(message.date).toLocaleTimeString()}</time>
                    </div>
                    <div class="chat-bubble">
                        {message.message}
                        {#if message.attachment.length > 0}
                            <div class="carousel w-full">
                                {#each message.attachment as attachment, i}
                                    <div id="slide1" class="carousel-item relative w-full">
                                        <img
                                                src={attachment}
                                                class="w-full"
                                        />
                                        <div class="absolute left-5 right-5 top-1/2 flex -translate-y-1/2 transform justify-between">
                                            {#if i > 0}
                                                <a href="#slide{i - 1}" class="btn btn-circle"></a>
                                            {/if}
                                            {#if i + 1 < message.attachment.length}
                                                <a href="#slide{i + 1}" class="btn btn-circle"></a>
                                            {/if}
                                        </div>
                                    </div>
                                {/each}
                            </div>
                        {/if}
                    </div>
                </div>
            {:else}
                <div class="chat chat-end">
                    <div class="chat-image">
                        {#if senderBProfile === null}
                            <div class="avatar avatar-placeholder">
                                <div class="bg-neutral text-neutral-content w-10 rounded-full">
                                    <span class="text-2xl">{senderBName[0]}</span>
                                </div>
                            </div>
                        {:else}
                            <div class="avatar">
                                <div class="w-10 rounded-full ring-2">
                                    <img src={senderBProfile} />
                                </div>
                            </div>
                        {/if}
                    </div>
                    <div class="chat-header">
                        {senderBName}
                        <time class="text-xs opacity-50">{new Date(message.date).toLocaleTimeString()}</time>
                    </div>
                    <div class="chat-bubble">
                        {message.message}
                        {#if message.attachment.length > 0}
                            <div class="carousel w-full">
                                {#each message.attachment as attachment, i}
                                    <div id="slide1" class="carousel-item relative w-full">
                                        <img
                                            src={attachment}
                                            class="w-full"
                                        />
                                        <div class="absolute left-5 right-5 top-1/2 flex -translate-y-1/2 transform justify-between">
                                            {#if i > 0}
                                                <a href="#slide{i - 1}" class="btn btn-circle"></a>
                                            {/if}
                                            {#if i + 1 < message.attachment.length}
                                                <a href="#slide{i + 1}" class="btn btn-circle"></a>
                                            {/if}
                                        </div>
                                    </div>
                                {/each}
                            </div>
                        {/if}
                    </div>
                </div>
            {/if}
        {/each}
    </div>

    <div class="sticky-footer w-full border-t border-base-400 mb-13">
        <div class="flex mt-2">
            {#if currentChatAttachment.length > 0}
                <div class="indicator" onclick={() => currentChatAttachment = []}>
                    <span class="indicator-item bg-transparent border-transparent text-xs">
                        {currentChatAttachment.length}
                    </span>
                    <Trash2 class="my-auto ml-2" />
                </div>
            {:else}
                <div class="my-auto" onclick={() => document.getElementById("fileInput").click()}>
                    <Camera class="ml-2" />
                </div>
            {/if}

            <div class="m-auto input w-3/4">
                <input type="text" id="chatInput">
            </div>

            <div class="flex my-auto" onclick={() => sendMessage()}>
                <SendHorizontal class="mr-2"  />
            </div>

            <input id="fileInput" type="file" style="display:none;" accept="image/png, image/jpeg" oninput={() => getNewProfilePicture()} />
        </div>

        {#if canReview}
            <div class="flex mx-2">
                <button class="btn btn-accent mt-4 w-full" onclick={() => openReview()}>Nutzer bewerten</button>
            </div>
        {:else}
            <div class="flex mx-2">
                <a class="btn btn-accent mt-4 w-full" href="/chat">Zurck zu meinen Chats</a>
            </div>
        {/if}
    </div>
</div>

{#if inReview}
    <div class="toast toast-center mb-15 bg-white min-w-full min-h-1/3 rounded-box" style="margin-bottom: -15px !important;">
        <p class="text-xl text-center mt-2">Wie war deine Erfahrung mit {senderAName}?</p>
        <div class="flex justify-center mt-2">
            <div class="rating rating-lg rating-half">
                <input type="radio" name="rating-11" class="rating-hidden" />
                <input type="radio" name="rating-11" class="mask mask-star-2 mask-half-1 bg-amber-400" aria-label="0.5 star" value="0.5" />
                <input type="radio" name="rating-11" class="mask mask-star-2 mask-half-2 bg-amber-400" aria-label="1 star" value="1.0" />
                <input type="radio" name="rating-11" class="mask mask-star-2 mask-half-1 bg-amber-400" aria-label="1.5 star" checked="checked" value="1.5" />
                <input type="radio" name="rating-11" class="mask mask-star-2 mask-half-2 bg-amber-400" aria-label="2 star" value="2.0" />
                <input type="radio" name="rating-11" class="mask mask-star-2 mask-half-1 bg-amber-400" aria-label="2.5 star" value="2.5" />
                <input type="radio" name="rating-11" class="mask mask-star-2 mask-half-2 bg-amber-400" aria-label="3 star" value="3.0" />
                <input type="radio" name="rating-11" class="mask mask-star-2 mask-half-1 bg-amber-400" aria-label="3.5 star" value="3.5" />
                <input type="radio" name="rating-11" class="mask mask-star-2 mask-half-2 bg-amber-400" aria-label="4 star" value="4.0" />
                <input type="radio" name="rating-11" class="mask mask-star-2 mask-half-1 bg-amber-400" aria-label="4.5 star" value="4.5" />
                <input type="radio" name="rating-11" class="mask mask-star-2 mask-half-2 bg-amber-400" aria-label="5 star" value="5.0" />
            </div>
        </div>
        <button class="btn btn-accent w-1/2 mx-auto mt-8" onclick={() => finishReview()}>Bewertung senden</button>
        <button class="btn w-1/2 mx-auto mt-2" onclick={() => inReview = false}>Spter</button>
    </div>
{/if}

<InvalidImageModal/>

<style>
    .flex-container {
        display: flex;
        flex-direction: column;
        overflow: hidden;
        height: 100vh;
        width: 100vw;
        max-height: 100vh;
    }

    .sticky-header {
        height: 4rem;
    }

    .content {
        display: flex;
        flex-direction: column;
        flex: 1;
        overflow-y: auto;
    }

    .sticky-footer {
        height: 4rem;
    }

    body {
        height: 100%;
        overflow-y: hidden;
    }
</style>
